function Table() {  
    const [inputField, setInputField] = useState([
        { firstname: '', latitude: '', longitude: '', address: ''},

    ]);

  return(

    <Container>

        <h1>Add New Locations</h1>

        <form>
            { inputField.map((inputField, index) => (
                <div key={index}>
                    <TextField 
                       name= "firstname"
                       lable= "First name"
                       value={inputField.firstname}

                    />

                </div>
            ))}

        </form>

    </Container>    

  );

}


export default Table;
